import logo from '../../images/logo01.svg';
import './style.css';
import styled from 'styled-components';

const Fonte = styled.f`
    display: flex;
    align-items: center;
    font-size: 50px;
`;


const LogoStyleImg = styled.img`
    margin-right: 10px;
    margin-left: 35px;
    height: 96px;
    width: 96px;
`;

const AppLogo = styled.div`
    display: flex;
    align-items: center;
    font-size: 50px;
`;

function Logo() {
    return (
        <AppLogo>
            <LogoStyleImg src={logo} alt="Logo" />
            <p className='just-me-again-down-here-regular'><strong>MoveX</strong></p>
        </AppLogo>
    );
}

export default Logo;
